import React, { useState } from 'react';
import './Header.css';

const Header = () => {
  const [activeMenu, setActiveMenu] = useState(null);

  const toggleSubMenu = (menu) => {
    setActiveMenu(activeMenu === menu ? null : menu);
  };

  return (
    <header className="header">
      <div className="header-logo">
        <img src="logo.png" alt="Logo" />
      </div>
      <nav className="header-nav">
        <div className="menu-item" onClick={() => toggleSubMenu('product')}>
          Product
          <span className="menu-arrow">
            {activeMenu === 'product' ? '▲' : '▼'}
          </span>
          {activeMenu === 'product' && (
            <div className="submenu">
              <div className="submenu-part">Product Part 1</div>
              <div className="submenu-part">Product Part 2</div>
              <div className="submenu-part">Product Part 3</div>
            </div>
          )}
        </div>
        <div className="menu-item" onClick={() => toggleSubMenu('about')}>
          About
          <span className="menu-arrow">
            {activeMenu === 'about' ? '▲' : '▼'}
          </span>
          {activeMenu === 'about' && (
            <div className="submenu">
              <div className="submenu-part">About Part 1</div>
              <div className="submenu-part">About Part 2</div>
              <div className="submenu-part">About Part 3</div>
            </div>
          )}
        </div>
        <div className="menu-item" onClick={() => toggleSubMenu('resources')}>
          Resources
          <span className="menu-arrow">
            {activeMenu === 'resources' ? '▲' : '▼'}
          </span>
          {activeMenu === 'resources' && (
            <div className="submenu">
              <div className="submenu-part">Resources Part 1</div>
              <div className="submenu-part">Resources Part 2</div>
              <div className="submenu-part">Resources Part 3</div>
            </div>
          )}
        </div>
        <div className="menu-item">
          Pricing
        </div>
      </nav>
      <div className="header-buttons">
        <button className="cta-button login-button">Login</button>
        <button className="cta-button sales-button">Talk to Sales</button>
        <button className="cta-button get-started-button">Get Started Free</button>
      </div>
    </header>
  );
};

export default Header;
